const TerminalComponent = () => {
  const [legs, setLegs] = useState([]);

  const initializeLegs = () => {
    const initialLegs = [
      { legNumber: 1, flightNumbers: [] },
      { legNumber: 2, flightNumbers: [] },
      { legNumber: 3, flightNumbers: [] },
      { legNumber: 4, flightNumbers: [] },
      { legNumber: 9, flightNumbers: [] },
      { legNumber: 8, flightNumbers: [] },
      { legNumber: 5, flightNumbers: [] },
      { legNumber: 7, flightNumbers: [] },
      { legNumber: 6, flightNumbers: [] },
    ];
    setLegs(initialLegs);
  };

  useEffect(() => {
    initializeLegs();
  }, []);

  return (
    <div className="terminal">
      <div className="line">
        {legs.slice(0, 5).map((leg) => (
          <div className="leg" key={leg.legNumber}>
            <h2>Leg {leg.legNumber}</h2>
            {leg.flightNumbers.length > 0 ? (
              leg.flightNumbers.map((flightNumber) => (
                <p key={flightNumber}>Flight: {flightNumber}</p>
              ))
            ) : (
              <p>No flights</p>
            )}
          </div>
        ))}
      </div>
      <div className="line">
        <div className="leg fourth-leg" key={4}>
          <h2>Leg 4</h2>
          {legs[3].flightNumbers.length > 0 ? (
            legs[3].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
        <div className="leg" key={8}>
          <h2>Leg 8</h2>
          {legs[5].flightNumbers.length > 0 ? (
            legs[5].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
        <div className="leg" key={5}>
          <h2>Leg 5</h2>
          {legs[6].flightNumbers.length > 0 ? (
            legs[6].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
      </div>
      <div className="line">
        <div className="leg" key={7}>
          <h2>Leg 7</h2>
          {legs[7].flightNumbers.length > 0 ? (
            legs[7].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
        <div className="leg" key={6}>
          <h2>Leg 6</h2>
          {legs[8].flightNumbers.length > 0 ? (
            legs[8].flightNumbers.map((flightNumber) => (
              <p key={flightNumber}>Flight: {flightNumber}</p>
            ))
          ) : (
            <p>No flights</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default TerminalComponent;
